На територію України у кожний населений пункт заїхали «сплячі групи». Вказані особи знімали квартири проживали там і чекали часу «Ч». В основному квартири знімали користуючись послугами ріелторів. В населених пунктах ( містах) у ріелторів існують свої робочі  чати. Прохання отримати інформацію від ріелторів по особам чоловічої статі схожих на росіян групами по 2-3 особи знімали житло в період з грудня 2021 по теперішній час. Та направити відповідні групи самооборони або правоохоронців на адреси арендованого житла з метою перевірки. Вказані особи зараз використовуються у якості коригувальників вогню та диверсійних груп та можуть бути озброєними.

